import React from 'react';
import PropTypes from 'prop-types';
import { Panel, PanelHeader, PanelHeaderBack, Group, Header, Cell, Avatar, Div, Button } from '@vkontakte/vkui';
// Импортирую иконки из @vkontakte/icons
import { Icon28EducationOutline, Icon28VideoOutline, Icon28BookOutline, Icon28CodeOutline, Icon28GlobeOutline } from '@vkontakte/icons';

export const Courses = ({ id, go }) => (
  <Panel id={id}>
    <PanelHeader
      left={<PanelHeaderBack onClick={go} data-to="home"/>}
    >
      Курсы
    </PanelHeader>
    <Group header={<Header mode="secondary">Выберите курс</Header>}>
      <Cell
        before={<Icon28CodeOutline />}
        expandable
        onClick={go}
        data-to="code"
      >
        Пишем код с нуля
      </Cell>
      <Cell
        before={<Icon28VideoOutline />}
        expandable
        onClick={go}
        data-to="design"
      >
        Рисуем дизайн с нуля
      </Cell>
      <Cell
        before={<Icon28BookOutline />}
        expandable
        onClick={go}
        data-to="graphic"
      >
        Граф дизайн с нуля
      </Cell>
      <Cell
        before={<Icon28EducationOutline />}
        expandable
        onClick={go}
        data-to="python"
      >
        Питон с нуля
      </Cell>
      <Cell
        before={<Icon28GlobeOutline />}
        expandable
        onClick={go}
        data-to="english"
      >
        English c нуля
      </Cell>
    </Group>
  </Panel>
);

Courses.propTypes = {
  id: PropTypes.string.isRequired,
  go: PropTypes.func.isRequired,
};

export default Courses;
